Race to Witch Mountain (2009)

Verenigde Staten
Avontuur / Science-Fiction
98 minuten

geregisseerd door Andy Fickman
met Dwayne Johnson, Carla Gugino en AnnaSophia Robb

Een UFO expert probeert met de hulp van een taxichauffeur twee broers en zussen met paranormale krachten te redden. Dit, omdat een kwade organisatie de kinderen wil gebruiken voor hun snode plannen.

